import React from "react";
import { Header } from "./homepage";
import { useNavigate } from "react-router";

function Main(props){
    let lgt=useNavigate();


function Logout(){ 

    localStorage.removeItem('auth');
    localStorage.removeItem('token');
    lgt('/');

 }

 
 
    return(
        <div>
         
         <Header login='Logout'  navi={Logout}   sidebar='mySidebar'  />

        </div>
    );
}

export default Main;



function Sample(){
    return(
        <div style={backgroundcolor}>

hi
        </div>
        );
}

export {Sample}
